    public function getSourceContext(): Source
    {
        return new Source("{% extends 'base.html.twig' %}
{% block title %}Product index{% endblock %}

{% block content %}
    <h1>Product index</h1>

    {{ form_start(searchForm) }}
    {{ form_widget(searchForm) }}
        <button class=\"btn\">{{ button_label|default('Search') }}</button>
    {{ form_end(searchForm) }}
    <br />

    <table class=\"table\">
        <thead>
            <tr>
                <th>Id</th>
                <th>Name</th>
                <th>Price</th>
                <th>Description</th>
                <th>Category</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for product in products %}
            <tr>
                <td>{{ product.id }}</td>
                <td>{{ product.name }}</td>
                <td>{{ product.price }}</td>
                <td>{{ product.description }}</td>
                <td>{{ product.category }}</td>
                <td>
                    <a href=\"{{ path('app_product_show', {'id': product.id}) }}\">show</a>
                    <a href=\"{{ path('app_product_edit', {'id': product.id}) }}\">edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"5\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

    <a href=\"{{ path('app_product_new') }}\">Create new</a>
{% endblock %}
", "product/index.html.twig", "/home/maksym/Documents/GitHub/symfony-app/templates/product/index.html.twig");
